import React from 'react';
import Axios from 'axios';
import remove from '../assets/remove.png';
import info from '../assets/info.png';
import {Modal,Button} from 'react-bootstrap';

class DeveloperinProject extends React.Component{
    constructor(props){
        super(props);
        this.delete=this.delete.bind(this)
        this.state={data:[],show:0}
        Axios.get(`http://localhost:3002/getdeveloperinproject/${this.props.proid}`).then(res=>{
            this.setState({data:res.data.developers}) 
            })
    }

    delete(id){
        this.setState({show:1});
        confirm("You are going to delete this user from the project");
        console.log(id);
        //Axios.delete(`http://localhost:3002/deletedevfromproject/${id}/${this.props.proid}`)
    }

    render(){
        const developers=this.state.data.map(i=>{
            return(
                <div style={{justifyContent:"center",display:"flex",border:"1px solid black",width:"fit-content",height:"fit-content",}}>
                    <h1>{i.name}</h1>
                    <img onClick={()=>this.delete(i.devid)} height="5%" width="5%" src={remove}/>
                    <h6>{i.currentStatus}</h6>
                    <a href={`/developerdetail/${i.devid}/${this.props.proid}`}><img height="30%" width="20%" src={info}/></a>
                </div>
            )
        })
        return(
            <div>
           <h1>{developers}</h1>
        <Modal show={this.state.show} onHide={this.handle}>
          <Modal.Header closeButton>
            <Modal.Title>Modal heading</Modal.Title>
          </Modal.Header>
          <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={this.handle}>
              Close
            </Button>
            <Button variant="primary" onClick={this.handle}>
              Save Changes
            </Button>
          </Modal.Footer>
        </Modal>
           </div>
        )
    }
}
export default DeveloperinProject;
